import React from 'react';
import { makeStyles } from '@mui/styles';
import { Card, CardContent } from '@mui/material';

const useStyles = makeStyles(() => ({
  root: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    backgroundImage: 'url("katie-smith-uQs1802D0CQ-unsplash.jpg")',

    backgroundSize: 'cover',
    backgroundPosition: 'center center',
    backgroundRepeat: 'no-repeat',
  },
  content: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'flex-start',
    maxWidth: '600px',
    padding: '2rem',
    backgroundColor: 'rgba(255, 255, 255, 0.8)',
    borderRadius: '8px',
  },
}));

export const Home = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <div className={classes.content}>
        <h1>Welcome to my website</h1>
        <p>
          Welcome to our recipe website! Discover delicious new dishes, search for old favorites,
          and explore our wide range of culinary categories. Whether you're an experienced cook or a
          beginner in the kitchen, we have something for everyone. Start cooking today and let your
          taste buds take the lead!
        </p>
        <Card>
          <CardContent>{/* Insert your content for the card here */}</CardContent>
        </Card>
      </div>
    </div>
  );
};
